import { useState } from "react";

console.log("hello");
const App = () => {
	const [counter, setCounter] = useState(0);
	console.log("hello");
	return (
		<div>
			<h1>counter</h1>
			<div>{counter}</div>
			<button onClick={() => setCounter(counter + 1)}>plus</button>
			<button onClick={() => setCounter(counter - 1)}>minus</button>
			<button onClick={() => setCounter(0)}>zero</button>
		</div>
	);
};

export default App;
